script: |
  super -f text -I q6403.spq | sort > q6403.out

inputs:
  - name: q6403.spq
    data: |
      SELECT DISTINCT - col1 FROM tab1 (FORMAT parquet) WHERE NOT ( NULL ) IN ( col0 - + col2 * + col1 ) AND NOT - col2 * col0 + + col0 >= NULL;
  - name: tab1

outputs:
  - name: q6403.out
    data: |
